import { Router } from "react-router-dom";
import ContactService from "./api/ContactService"
//import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
      <h1>Helo world!</h1>
      <ul>
        <li><a href="/">Link</a></li>
        <li><a href="/">Link</a></li>
        <li><a href="/">Link</a></li>
      </ul>
      //<ContactService></ContactService>
      <Router>
        <Switch>
          <Route exact path="/" component={ContactService} />
          <Route exact path="/" component={ContactService} />
          <Route exact path="/" component={ContactService} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
